  \"2015-09-03T05:38:13.991329\",\n\t\"name\": \"fppc-803-behested-payment-report\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In accordance with the California Government
  Code section 82015, payments made at the behest of elected officials are presumed
  not to be contributions if they meet the following guidelines:(a) the payments are
  made principally for legislative, governmental, or charitable purposes, and(b) the
  payments are made principally for purposes unrelated to the official's candidacy
  for elected office.Although such payments are not contributions, they MUST BE REPORTED
  on the Report of Payments Made at the Behest of an Elected Officer form to the elected
  officer's agency within 30 days after the total payments made by a single source
  equal to or exceed $5,000 in a calendar year. The agency must forward a copy of
  the report to the Ethics Commission within 30 days of its receipt.After the $5,000
  threshold is met for a particular calendar year, all subsequent payments made by
  the same source during the calendar year must be reported by the elected officer
  within 30 days after the date the payment is made.These reports are public records.
  \ The table includes all FPPC 803 forms filed with the Ethics Commission from April
  20, 2015 to the present.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
